import "./home.css";
import "./nav.css";
import { useParams } from "react-router-dom";




export default function Home() {
  const { date, arrival, departure } = useParams();
  const [single_s, setsingle_s] = useState([]);
  const [multi_s, setmulti_s] = useState([]);
  console.log(date);
  useEffect(() => {
    axios.get('http://localhost:5000/home/' + date + '/' + arrival + '/' + departure,{withCredentials: true})
        .then(res => {

            setsingle_s(res.data)

        })
        .catch(err => {
            if(err.response.status===401){
            }
        })
}, [])







  return (
    <Fragment>
      <table>
        <thead>
          <tr>
            <th>sid</th>
            <th>from_loc</th>
            <th>to_loc</th>
            <th>from_time</th>
            <th>to_time</th>
            <th>price</th>
            <th>available</th>
            <th>book</th>
          </tr>
        </thead>
        <tbody>
          {single_s.map((item) => (
            <tr key={item.sid}>
              <td>{item.sid}</td>
              <td>{item.from_loc}</td>
              <td>{item.to_loc}</td>
              <td>{item.from_time}</td>
              <td>{item.to_time}</td>
              <td>{item.price}</td>
              <td>{item.capacity - item.filled}</td>
              <td><button>book</button></td>
            </tr>
          ))}
        </tbody>
      </table>








    </Fragment>
  );
}
